        </svg> */}
        <svg fill="white" height="40" viewBox="0 0 24 24" width="40" className="toggle-button" onClick={() => setShowNavMenu(!showNavMenu)}>
            <path d="M4 6H20M4 12H20M4 18H20" stroke="#999" stroke-linecap="round" stroke-linejoin="round" stroke-width="2"/>
        </svg>
        <div className={`navbar-links ${showNavMenu ? "active" : ""}`}>
            <ul>
                <li><Link to="/games">Play Game</Link></li>
                <li><Link to="">Skrall Gaming</Link></li>
                <li><Link to="">GenStock</Link></li>
                <li><Link to="">Login</Link></li>
            </ul>
        </div>
    </nav>
}
